const primary_color = '#563D7C';

const MyStyle = {
    col_primary: {
        primary_color,
    },
    col_background: {
        background: primary_color,
        color: "white",
    },
    col_text: {
        color: primary_color
    },
    col_border: {
        border: `5px solid ${primary_color}`,
        color: ReactDOM,
    }
}

export default MyStyle;
